OUTFD=$2

TMP_PATH=/tmp/fed_patcher
BOOT_EXPANDED=${TMP_PATH}/boot_expanded
BOOT_RAMDISK=${BOOT_EXPANDED}/ramdisk_expanded

BUSYBOX=${TMP_PATH}/busybox
MKBOOTIMG=${TMP_PATH}/mkbootimg
UNMKBOOTIMG=${TMP_PATH}/unmkbootimg

mkdir -p ${TMP_PATH}

ui_print() {
	echo -n -e "ui_print $1\n"
}

get_prop() {
    if ! test -f '/system/build.prop'; then
        ui_print "! Your /system/build.prop could not be found!"
        exit 1
    fi
    if ! test $# -eq 1; then
        ui_print "! get_prop: Expected 1 parameter but got $#"
        exit 1
    fi

    ${BUSYBOX} grep "^$1=" /system/build.prop \
    | ${BUSYBOX} sed -e"s/^[^=]\+=\(.*\)/\1/" \
    | ${BUSYBOX} head -n 1
}

