unpack_bootimg_utils_arm32() {
    ui_print "- Unpacking mkbootimg/unmkbootimg ..."
    unpack_mkbootimg_arm32
    unpack_unmkbootimg_arm32
}

unpack_bootimg_utils_arm64() {
    ui_print "- Unpacking mkbootimg/unmkbootimg ..."
    unpack_mkbootimg_arm64
    unpack_unmkbootimg_arm64
}


ui_print "*********************************"
ui_print "* Force-Encrypt Disable Patcher *"
ui_print "*********************************"

${BUSYBOX} mkdir -p ${TMP_PATH}

RO_PRODUCT_DEVICE=flounder_lte
ui_print "  => Found device: ${RO_PRODUCT_DEVICE}"

case ${RO_PRODUCT_DEVICE} in
    bullhead)
        BOOT_BLKDEV=$(${BUSYBOX} readlink -f /dev/block/platform/soc.0/f9824900.sdhci/by-name/boot)
        FSTAB_LIST=fstab.bullhead
        unpack_bootimg_utils_arm64
        ;;
    ether)
        BOOT_BLKDEV=$(${BUSYBOX} readlink -f /dev/block/bootdevice/by-name/boot)
        FSTAB_LIST='fstab.qcom'
        unpack_bootimg_utils_arm64
        ;;
    flounder|flounder_lte)
        BOOT_BLKDEV=$(${BUSYBOX} readlink -f /dev/block/platform/sdhci-tegra.3/by-name/LNX)
        FSTAB_LIST='fstab.flounder fstab.flounder64'
        unpack_bootimg_utils_arm64
        ;;
    foster)
        BOOT_BLKDEV=$(${BUSYBOX} readlink -f /dev/block/platform/sdhci-tegra.3/by-name/LNX)
        FSTAB_LIST='fstab.darcy fstab.e2190 fstab.e2220 fstab.foster_e fstab.foster_e_hdd fstab.hawkeye fstab.he2290 fstab.jetson_cv fstab.jetson_e fstab.loki_e_base fstab.loki_e_lte fstab.loki_e_wifi fstab.t18x-interposer'
        unpack_bootimg_utils_arm64
        ;;
    shamu)
        BOOT_BLKDEV=$(${BUSYBOX} readlink -f /dev/block/platform/msm_sdcc.1/by-name/boot)
        FSTAB_LIST=fstab.shamu
        unpack_bootimg_utils_arm32
        ;;
    *)
        ui_print "! This device is not supported!"
        exit 1
        ;;
esac

ui_print "- Dumping boot.img ..."
cp boot-org.img ${TMP_PATH}/boot.img
cp busybox ${TMP_PATH}/busybox

cd ${TMP_PATH}

ui_print "- Searching for boot-signature ..."
for offset in 0 256 512; do
    if test $(${BUSYBOX} dd if=${TMP_PATH}/boot.img bs=1 skip=$offset count=8 2>/dev/null) == "ANDROID!"; then
        ui_print "  => Signature found at offset $offset!"
        BOOT_SIG_OFFSET=$offset
    fi
done

if test -z "${BOOT_SIG_OFFSET}"; then
    ui_print "! The boot-signature could not be found!"
    exit 1
fi

if test ${BOOT_SIG_OFFSET} -gt 0; then
    ui_print "- Stripping boot.img ..."
    ${BUSYBOX} mv ${TMP_PATH}/boot.img ${TMP_PATH}/boot.img.tmp
    ${BUSYBOX} dd if=${TMP_PATH}/boot.img.tmp of=${TMP_PATH}/boot.img bs=256 skip=$(${BUSYBOX} expr ${BOOT_SIG_OFFSET} \/ 256)
    ${BUSYBOX} rm -f ${TMP_PATH}/boot.img.tmp
fi

ui_print "- Unpacking boot.img ..."
if test -d "${BOOT_EXPANDED}"; then rm -rf "${BOOT_EXPANDED}"; fi
${BUSYBOX} mkdir -p ${BOOT_EXPANDED}
cd ${BOOT_EXPANDED}
MKBOOTIMG_ARGUMENTS=$(
    ${UNMKBOOTIMG} -i ${TMP_PATH}/boot.img \
    | ${BUSYBOX} egrep '^  mkbootimg' \
    | ${BUSYBOX} sed -e's/^ *mkbootimg *//' \
    | ${BUSYBOX} sed -e's/ *\-\-kernel [^ ]\+ */ /' \
    | ${BUSYBOX} sed -e's/ *\-\-ramdisk [^ ]\+ */ /' \
    | ${BUSYBOX} sed -e's/ *\-o [^ ]\+ */ /' \
    | ${BUSYBOX} sed -e 's/"/\\"/g'
); RETVAL=$?
if ! test ${RETVAL} -eq 0; then
    ui_print "! Unpacking failed"
    ui_print "  => unmkbootimg return value: ${RETVAL}"
    exit 1
fi
if ! test -f ramdisk.cpio.gz; then
    ui_print "! Unpacking failed"
    ui_print "  => ramdisk.cpio.gz is missing"
    exit 1
fi
${BUSYBOX} gunzip ramdisk.cpio.gz; RETVAL=$?
if ! test ${RETVAL} -eq 0; then
    ui_print "! Unpacking failed"
    ui_print "  => gunzip return value: ${RETVAL}"
    exit 1
fi
${BUSYBOX} mkdir -p ${BOOT_RAMDISK}
cd ${BOOT_RAMDISK}
${BUSYBOX} cpio -idm < ../ramdisk.cpio; RETVAL=$?
if ! test ${RETVAL} -eq 0; then
    ui_print "! Unpacking failed"
    ui_print "  => cpio return value: ${RETVAL}"
    exit 1
fi

ui_print "- Patching fstab ..."
FSTAB_PATCHED=0
for f in ${FSTAB_LIST}; do
    if ! test -f $f; then
        ui_print "~ The fstab file $f could not be found!"
        continue
    fi
    if ! test -f "${TMP_PATH}/$f"; then
        ${BUSYBOX} cp $f ${TMP_PATH}/
    fi

    ${BUSYBOX} cat ${TMP_PATH}/$f \
    | ${BUSYBOX} sed -e"s/\(force\(encrypt|fdeorfbe\)\)/encryptable/g" \
    | ${BUSYBOX} sed -e"s/,\?verify=[^,]\+\(,.\+\)*$/\1/g" \
    > ${BOOT_RAMDISK}/$f

    FSTAB_PATCHED=1
done

if test ${FSTAB_PATCHED} -eq 0; then
    ui_print "! No fstab files could be found!"
    exit 1
fi

ui_print "- Creating new boot.img ..."
${BUSYBOX} find . -print \
    | ${BUSYBOX} cpio -odm -H newc \
    | ${BUSYBOX} gzip -c \
    > ${BOOT_EXPANDED}/ramdisk-new.cpio.gz

cd ${BOOT_EXPANDED}
sh -c "${MKBOOTIMG} \
    ${MKBOOTIMG_ARGUMENTS} \
    --kernel kernel \
    --ramdisk ramdisk-new.cpio.gz \
    -o ${TMP_PATH}/boot-new.img"
RETVAL=$?

if ! test ${RETVAL} -eq 0; then
    ui_print "! Creation failed"
    ui_print "  => mkbootimg return value: ${RETVAL}"
    exit 1
fi

ui_print "- Done !"
